column17:
Prestar sus servicios profesionales como abogado ante la Secretaría de Turismo de la Gobernación de San Andrés; Providencia y Santa Catalina;
brindando orientación en materia contractual; administrativa y judicial; y apoyando además
en la revisión y expedición de documentos y actos administrativos.

